package com.froad.fft.thirdparty.dto.request.points;

public class PayPoints {

	private String payPointsNo;
	
	private String objectNo;
	
	private String objectDes;
	
	private String objectType;
	
	private String accountId;
	
	private String points;
	
	private String bankId;
	
	private String bankOrderNo;

	public String getPayPointsNo() {
		return payPointsNo;
	}

	public void setPayPointsNo(String payPointsNo) {
		this.payPointsNo = payPointsNo;
	}

	public String getObjectNo() {
		return objectNo;
	}

	public void setObjectNo(String objectNo) {
		this.objectNo = objectNo;
	}

	public String getObjectDes() {
		return objectDes;
	}

	public void setObjectDes(String objectDes) {
		this.objectDes = objectDes;
	}

	public String getObjectType() {
		return objectType;
	}

	public void setObjectType(String objectType) {
		this.objectType = objectType;
	}

	public String getAccountId() {
		return accountId;
	}

	public void setAccountId(String accountId) {
		this.accountId = accountId;
	}

	public String getPoints() {
		return points;
	}

	public void setPoints(String points) {
		this.points = points;
	}

	public String getBankId() {
		return bankId;
	}

	public void setBankId(String bankId) {
		this.bankId = bankId;
	}

	public String getBankOrderNo() {
		return bankOrderNo;
	}

	public void setBankOrderNo(String bankOrderNo) {
		this.bankOrderNo = bankOrderNo;
	}
	
	
}
